const navBar = props => {
 <ul>
   <li><Link to='/crisps'>Crisps</Link></li>
      <li><Link to='/chocolate'>Chocolate</Link></li>
      <li><Link to='/lollipop'>Lollipop</Link></li>
 </ul> 
